comments:
@file: membrane_highres
@desc: All atom energy function for membrane proteins: combines Rosetta's
all atom energy function with membrane environment and solvation from the
lazaridis-karplus implicit membrane model.
@note: deprecated - use mpframework instead
@cite: Barth, 2007, PNAS

@file: membrane_highres_Menv_smooth
@desc: All atom energy function for membrane proteins: combines Rosetta's
all atom energy function with membrane environment and solvation from the
lazaridis-karplus implicit membrane model.
@note: continuous for minimization, deprecated - use mpframework instead
@cite: Barth, 2007, PNAS

file: mpframework_cen_2014.wts
@desc: Scores low resolution pairwise, packing density, and environment energies
in a 5-layer membrane environment. Also includes penalties for structures unfavorably
embedded in the membrane.
@note: supported by the membrane framework
@cite: [Yarov-Yaravoy, 2006, Proteins]
Mlipo 1.0

file: mpframework_fa_2014.wts
@desc: All atom energy function for membrane proteins: combines Rosetta's
all atom energy function with membrane environment and solvation from the
lazaridis-karplus implicit membrane model.
@note: supported by the membrane framework - but use mpframework_smooth_fa instead
@cite: Barth, 2007, PNAS

file: mpframework_pHmode_fa_2014.wts
@desc: Combines the smoothed membrane all atom energy function with
pH mode - enables the packer to sample protonated rotamers where
applicable at a given pH (specified via command line)
@note: supported by the membrane framework
@cite: Terms from [Barth, 2007, PNAS] and [Kilambi, 2013, Proteins]

file: mpframework_smooth_fa_2014.wts
@desc: All atom energy function for membrane proteins: combines Rosetta's
all atom energy function with membrane environment and solvation from the
lazaridis-karplus implicit membrane model.
@note: supported by the membrane framework - continuous for minimization
@cite: Barth, 2007, PNAS

file: mpframework_smooth_fa_2014.wts
@desc: All atom energy function for membrane proteins: combines Rosetta's
all atom energy function with membrane environment and solvation from the
lazaridis-karplus implicit membrane model.
@note: supported by the membrane framework - continuous for minimization
@cite: Barth, 2007, PNAS

file: mpframework_symdock_cen_2014.wts
@desc: Low resolution membrane scoring function with low resolution
protein-protein docking score terms (used in regular docking protocol)
@note: Supported by the membrane framework - 2014
@cite: Terms from [Yarov-Yaravoy, 2006, Proteins] and [Gray, 2003, Journal
of Molecular Biology]
membrane
docking

file: score_membrane.wts
@desc: Scores low resolution pairwise, packing density, and environment energies
in a 5-layer membrane environment. Also includes penalties for structures unfavorably
embedded in the membrane.
@note: Deprecated: Consider using mpframework_cen_2014 (2014)
@cite: [Yarov-Yaravoy, 2006, Proteins]
